contracts/ProductTracking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Whitelist.sol";

contract ProductTracking is Whitelist {
    struct Product {
        uint256 productId;
        string productName;
        uint256 lotId;
        address manufacturer;
        address currentOwner;
        uint256 purchaseDate;
    }

    mapping(uint256 => Product) public products;
    uint256 public productCounter;

    event ProductAdded(uint256 indexed productId, string productName, address indexed manufacturer, uint256 lotId);
    event ProductTransferred(uint256 indexed productId, address indexed from, address indexed to);

    constructor() {
        productCounter = 0;
    }

    function addProduct(
        string memory _productName,
        uint256 _lotId
    ) public onlyWhitelisted {
        productCounter++;
        uint256 productId = productCounter;

        products[productId] = Product({
            productId: productId,
            productName: _productName,
            lotId: _lotId,
            manufacturer: msg.sender,
            currentOwner: msg.sender,
            purchaseDate: block.timestamp
        });

        emit ProductAdded(productId, _productName, msg.sender, _lotId);
    }

    function transferProduct(
        uint256 _productId,
        address _newOwner
    ) public {
        require(products[_productId].currentOwner == msg.sender, "ProductTracker: Only the current owner can transfer this product");
        require(_newOwner != address(0), "ProductTracker: New owner address cannot be zero.");

        products[_productId].currentOwner = _newOwner;

        emit ProductTransferred(_productId, msg.sender, _newOwner);
    }

    function getProductDetails(uint256 _productId) public view returns (Product memory) {
        require(products[_productId].productId != 0, "ProductTracker: Product does not exist.");
        return products[_productId];
    }
}

contracts/Whitelist.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Ownership.sol";

contract Whitelist is Ownership {
    mapping(address => bool) private whitelistedAddresses;

    event AddressAddedToWhitelist(address indexed participant);
    event AddressRemovedFromWhitelist(address indexed participant);

    function addToWhitelist(address _participant) public onlyOwner {
        require(_participant != address(0), "WhitelistManager: Cannot add zero address");
        require(!whitelistedAddresses[_participant], "WhitelistManager: Address is already whitelisted");

        whitelistedAddresses[_participant] = true;
        emit AddressAddedToWhitelist(_participant);
    }

    function removeFromWhitelist(address _participant) public onlyOwner {
        require(whitelistedAddresses[_participant], "WhitelistManager: Address is not whitelisted");

        whitelistedAddresses[_participant] = false;
        emit AddressRemovedFromWhitelist(_participant);
    }

    function isWhitelisted(address _participant) public view returns (bool) {
        return whitelistedAddresses[_participant];
    }

    modifier onlyWhitelisted() {
        require(whitelistedAddresses[msg.sender], "WhitelistManager: You are not authorized");
        _;
    }
}

contracts/Ownership.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Ownership {
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    constructor() {
        owner = msg.sender; // Le déployeur du contrat devient le propriétaire
        emit OwnershipTransferred(address(0), owner);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }
}

